export const exercisesGradeIX = [
    {
        title: "Elemente de bază ale limbajului",
        accent: "primary",
        grade: "ix",
        description: `Această secțiune conține exerciții introductive în limbajul C++,
        modelat după curriculum-ul școlar al clasei IX.`
    },
    {
        title: "Tablouri unidimensionale",
        accent: "primary",
        grade: "ix",
        description: `Această secțiune conține exerciții care presupun manipularea,
        modificarea și prelucrarea vectorilor.`
    },
    {
        title: "Tablouri bidimensionale",
        accent: "primary",
        grade: "ix",
        description: `Această secțiune conține exerciții care presupun manipularea,
        modificarea și prelucrarea matricelor.`
    }
];

export const exercisesGradeX = [
    {
        title: "Subprograme",
        accent: "secondary",
        grade: "x",
        description: `Această secțiune conține exerciții care presupun lucrul
    partiționat, modular și aranjat cu ajutorul subprogramelor.`
    },
    {
        title: "Recursivitate",
        accent: "secondary",
        grade: "x",
        description: `Această secțiune conține exerciții care presupun rezolvarea
    exercițiilor într-un mod recursiv.`
    },
    {
        title: "Șiruri de caractere",
        accent: "secondary",
        grade: "x",
        description: `Această secțiune conține exerciții care presupun manipularea,
    modificarea și prelucrarea șirurilor de caractere.`
    },
    {
        title: "Divide et impera",
        accent: "secondary",
        grade: "x",
        description: `Această secțiune conține exerciții care presupun utilizarea algoritmilor
    ce utilizează metoda “Divide et impera”.`
    },
    {
        title: "Structuri de date",
        accent: "secondary",
        grade: "x",
        description: `Această secțiune conține exerciții care presupun utilizarea structurilor 
    de date neomogene din C++.`
    }
];

export const exercisesGradeXI = [
    {
        title: "Metoda Backtracking",
        accent: "tertiary",
        grade: "xi",
        description: `Această secțiune conține exerciții care presupun utilizarea metodei
        “backtracking” pentru a rezolva exerciții.`
    },
    {
        title: "Metoda Greedy",
        accent: "tertiary",
        grade: "xi",
        description: `Această secțiune conține exerciții care presupun utilizarea metodei
        “Greedy” pentru a rezolva exerciții.`
    },
    {
        title: "Programare dinamică",
        accent: "tertiary",
        grade: "xi",
        description: `Această secțiune conține exerciții care presupun aplicarea
        conceptelor programării dinamice.`
    },
    {
        title: "Teoria Grafurilor",
        accent: "tertiary",
        grade: "xi",
        description: `Această secțiune conține exerciții care presupun lucrarea cu grafuri.`
    },

    {
        title: "Structuri de date arborescente",
        accent: "tertiary",
        grade: "xi",
        description: `Această secțiune conține exerciții care presupun utilizarea
        acestor structuri de date.`
    }
];
